function genereeri_laul() {
    // Leian nupu elemendi
    const gen_nupp = document.getElementById("gen_nupp");
    // Muudan nupu 'reageerivaks' muutes hetkeks nuppu vähem läbipaistvaks
    gen_nupp.style.backgroundColor = "rgba(29, 185, 84, 0.65)";
    setTimeout(() => {
        gen_nupp.style.backgroundColor = "";
    }, 300);

    // Genereerin suvalise arvu 1-3512 (laulude arv andmebaasis)
    const suvaline_arv = Math.floor((Math.random() * 3512) + 1);

    //Leian genereeritud arvule vastava laulu info
    const laulu_andmed = laulude_andmebaas.get(suvaline_arv);
    const laulu_nimi = laulu_andmed[0];
    const laulu_id = laulu_andmed[1];
    const laulu_zanr = laulu_andmed[2];
    // Mõnel laulul on määratud vaid üks žanr, sel juhul määran teiste žanrite muutuja väärtuseks "-"
    if (laulu_andmed[3] != "") {
        laulu_teised_zanrid = laulu_andmed[3];
    } else {
        laulu_teised_zanrid = "-";
    };
    

    // Leian vastusesildid ja kuvan sinna genereeritud laulu andmed
    const vastusesildid = document.getElementsByClassName("vastusesilt");
    vastusesildid[0].innerHTML = laulu_nimi;
    vastusesildid[1].innerHTML = laulu_zanr;
    vastusesildid[2].innerHTML = laulu_teised_zanrid;
    
    //vastusesilt.innerHTML = "Laulu nimi: " + laulu_nimi + "<br>Laulud id: " + laulu_id + "<br>Laulu žanr: " + laulu_zanr;

    // Leian spotify ühendusega elemendi ja uuendan kuvatavat laulu
    const spotify = document.getElementById("spotify");
    spotify.src = "https://open.spotify.com/embed/track/" + laulu_id + "?utm_source=generator";
}

// Funktsioon esimese suvalise laulu genereerimiseks, kui leht laetakse
function esimene_genereerimine(){
    // Genereerin esimese laulu
    genereeri_laul();
    // Eemaldan funktsiooni, et ei jääks laadimise tsüklisse kinni
    spotify_player.removeEventListener("load", esimene_genereerimine);
};


// Käivitan koodi alles peale HTML elementide laadimist, muidu ei leia js elemente üles
document.addEventListener("DOMContentLoaded", function() {
    // Lisan Generaatorinupule klikkamisfunktsiooni
    const gen_nupp = document.getElementById("gen_nupp");
    gen_nupp.addEventListener("click", genereeri_laul);

    // Lisan spotify Iframe-le funktsiooni elemendi laadimise tuvastamiseks
    spotify_player = document.getElementById("spotify");
    spotify_player.addEventListener("load", esimene_genereerimine)
});

